SELECT PART.P_BRAND, LINEITEM.L_PARTKEY, PARTSUPP.PS_SUPPKEY, ORDERS.O_CLERK FROM ORDERS JOIN LINEITEM ON LINEITEM.L_ORDERKEY=ORDERS.O_ORDERKEY JOIN PARTSUPP ON PARTSUPP.PS_SUPPKEY=LINEITEM.L_SUPPKEY JOIN PART ON PART.P_PARTKEY=PARTSUPP.PS_PARTKEY WHERE LINEITEM.L_QUANTITY != 19 AND LINEITEM.L_COMMITDATE > '1995-10-07' ORDER BY PARTSUPP.PS_SUPPKEY ASC, PART.P_BRAND ASC;
